//配置路由
import Vue from 'vue'
import VueRouter from 'vue-router'
//使用插件
Vue.use(VueRouter);
//引入路由组件

import  {Home ,Login, Search ,Register}  from '@/pages'
//配置路由，首先暴露
export default new VueRouter(

    {
        //配置路由
        routers:[
            {
                path:"/home",
                component:Home
            },
            {
                path:"/login",
                component:Login
            },
            {
                path:"/search",
                component:Search
            },
            {
                path:"/register",
                component:Register
            },
        ]
    
    }

)
